import React from "react";

const Bottomnav = () => {
  return (
    <nav className="navContainer">
      <a className="navLink" href="#">
        Inbox
      </a>
      <a className="navLink" href="#">
        Keywords
      </a>
      <a className="navLink" href="#">
        Settings
      </a>
    </nav>
  );
};

export default Bottomnav;
